import React, { useState, useEffect } from 'react';
import Papa from 'papaparse';

function CsvLoader({ onDataLoaded }) {
    const [data, setData] = useState([]);

    useEffect(() => {
        // Parse the CSV file located in the public folder
        Papa.parse('/Counties for Texas Agricultural Statistical Districts.csv', {
            download: true,
            header: true, // Assumes the CSV has headers
            complete: (results) => {
                setData(results.data); // Set the parsed data to state
                onDataLoaded(results.data); // Pass the data back to the parent component
            },
            error: (error) => {
                console.error('Error parsing CSV:', error);
            },
        });
    }, []);

    return null; // No need to display anything from this component
}

export default CsvLoader;
